import React from "react";
 import { useDispatch } from "react-redux";
 import { incrementStep } from "../../../../redux/Slices/RegisterSlice";
 import { AppDispatch } from "../../../../redux/Store";
 import { StyledNextButton } from "../RegisterNextButton/StyledNextButton";
 import './RegisterFormTwo.css';
 import { CheckBox } from "../../../../components/Checkbox/CheckBox";


 export const RegisterFormTwo:React.FC = () =>{
    const dispatch:AppDispatch = useDispatch(); 

    const NextStep = () => {
        dispatch(incrementStep());
    }


    return(
        <div className="reg-step-two-container">
            <div className="reg-step-two-content">
                <h1 className="reg-step-two-header">
                    Customize your experience
                </h1>
                <h3 className="reg-step-two-subhead">
                    Tract where you see twitter content on the web.
                </h3>
                <div className="reg-step-two-toggle-group">
                    <p className="reg-step-two-privacy">
                        Twitter uses this data to personalize your experience. This web browser history will never be stored with your name, email, or phone number.
                    </p>
                    <CheckBox/>
                </div>
                <p className=" reg-step-two-policy">
                    By signing up, you agree to our <span className="reg-step-two-link">Terms</span>, <span className="reg-step-two-link"> Privacy Policy </span> and <span className="reg-step-two-link">Cookies use</span>. Twitter may use your contact information, including your 
                    email address and phone number for the purpose outline in our Privacy Policy. <span className="reg-step-two-link">Learn More</span>
                </p>
            </div>
             <StyledNextButton active={true} color={"black"} onClick={ NextStep}>Next</StyledNextButton>
        </div>
    )
 }
